import "./App.css";
import { useEffect, useState } from "react";
import Axios from "axios";

function App() {

    const [itemlist,setItemList] = useState([]);

    useEffect(()=> {
        Axios.get("localhost:3001/items").then((response) => {
            setItemList(response.data);
        }).catch((err)=>{
            console.log(err);
        })
    })


    return (
        <div className="App">
            <input type="text" placeholder="Search"/>
            <table>
                <tbody>
                    <tr>
                        <th>Item Id</th>
                        <th>Item Name</th>
                        <th>Availability</th>
                    </tr>
                </tbody>
            </table>
                {itemlist.map((val,key)=> {
                    return (
                        <div className="item" key={key}>
                                <p>{val.ItemID}</p>
                                <p>{val.Item_Name}</p>
                                <p>{val.Availability}</p>
                        </div>
                    )
                })}
        </div>
    )
}

export default App;
